import React from 'react';
import './app.scss';
import Header from '../src/components/header';
import DealBox from '../src/components/deal-box';
import CapsuleTab from '../src/components/capsule-tab';
import TextTab from '../src/components/text-tab';

function App() {
  return (
    <div className="page-wrap">
      <Header />

      <section className="content-box">
        <h2 className="main-title">Today's Deals</h2>
        <div className="row-scroll">
          <DealBox />
        </div>
      </section>

      <section className="content-box">
        <h2 className="main-title">Active Promos</h2>
        <div className="row-scroll">
          <CapsuleTab />
        </div>
      </section>

      <section className="filter-tab-wrap">
        <div className="row-scroll">
          <TextTab />
        </div>
      </section>

      <section className="content-box">
        <h2 className="main-title">Previous Orders</h2>
        <div className="item-wrap">

        </div>
      </section>

      <div className="btm-fixed">
        <button className="btn">I am a button</button>
      </div>
    </div>
  );
}

export default App;
